import React, { useState, useEffect } from 'react';
import axios from 'axios';

const QueueComponent = ({ match }) => {
  const { queueType } = match.params;
  const [queueData, setQueueData] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(`http://localhost:3001/main-table/${queueType}`);
        setQueueData(response.data); // Assuming the response.data is an array of queue items
      } catch (error) {
        console.error('Error fetching queue data:', error);
        setError(error); // Set the error state
      }
    };

    fetchData();
  }, [queueType]);

  if (error) {
    return <div>Error fetching data: {error.message}</div>;
  }

  return (
    <div>
      <h1>{queueType} Queue</h1>
      <ul>
        {queueData.map((item) => (
          <li key={item._id}>
            {item.name} - {item.turnId}
          </li>
        ))}
      </ul>
    </div>
  );
};

const TestQueue = () => {
  const queueTypes = ['receptionQueue', 'ecgQueue', 'treatmentQueue', 'triageQueue', 'doctorQueue'];

  return (
    <div>
      {queueTypes.map((queueType) => (
        <QueueComponent key={queueType} match={{ params: { queueType } }} />
      ))}
    </div>
  );
};

export default TestQueue;
